import React from 'react'
import {PotraitContainer,PotraitHeading,PotraitWrapper,PotraitCard,PotraitImg} from './PotraitsElements'

const Potraits = ({heading,data}) => {
    return (
        <PotraitContainer>
            <PotraitHeading>{heading}</PotraitHeading>
            <PotraitWrapper>
                {data.map((potrait,index)=>{
                    return(
                        <PotraitCard key={index}>
                        <PotraitImg src={potrait.img} alt={potrait.alt} />
                        </PotraitCard>
                    );
                })}
            </PotraitWrapper>
        </PotraitContainer>
    )
}

export default Potraits
